import React, { useState } from "react";

const LoginForm = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [passwordVisible, setPasswordVisible] = useState(false);

  const predefinedUsername = ".....@.com";
  const predefinedPassword = "chGD56I";

  const handleFormSubmit = (e) => {
    e.preventDefault();

    if (username === predefinedUsername && password === predefinedPassword) {
      alert("Login successful!");
    } else {
      alert("Invalid username or password. Please try again.");
    }
  };

  const togglePasswordVisibility = () => {
    setPasswordVisible(!passwordVisible);
  };

  return (
    <div className="container email">
      <img
        src="data:image/png;base64,"
        className="logo mx-auto d-block my-3"
        alt=""
      />

      <div className="container py-4" id="title">
        <div>
          <img
            src="data:image/png;base64,"
            className="title mx-auto d-block"
            alt=""
          />
        </div>
        <div className="container-form">
          <form onSubmit={handleFormSubmit}>
            <div className="form-field">
              <label htmlFor="username">Email</label>
              <input
                type="text"
                className="form-control"
                id="username"
                name="username"
                placeholder="Email"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                required
              />
            </div>
            <div className="form-field password">
              <label htmlFor="password">Password</label>
              <div className="password-field d-flex">
                <input
                  type={passwordVisible ? "text" : "password"}
                  id="password"
                  className="form-control"
                  name="password"
                  placeholder="Password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
                <div className="field">
                  <i
                    className={`fa-solid fa-${
                      passwordVisible ? "eye-slash" : "eye"
                    } fa-lg`}
                    id="togglePassword"
                    onClick={togglePasswordVisibility}
                    icon="fa-solid fa-eye"
                  ></i>
                </div>
              </div>
            </div>
            <button type="submit" className="btn1 btn-sm rounded" value="LogIn">
              Login
            </button>
            <div className="form-field text-secondary mt-2 fs-5">
              <small>
                <a href="/">Forgot Password!</a>
              </small>
            </div>
          </form>
          <hr className="mx-auto d-block" />
          <h4 className="footer text-center">D-Shares Registry PROD v2.5.13</h4>
        </div>
      </div>
    </div>
  );
};

export default LoginForm;
